import Header from '../components/Header';
import SideNav from '../components/SideNav';
import TopBarNav from '../components/TopBarNavigator'
import '../resources/globalStyles.css'

export default class Index extends React.Component {
    render() {
        return (
            
            <div style={{flexDirection: 'column', display: 'flex', margin: 0, padding: 0, border: 0}}>
                
                <TopBarNav />
                <div style={{flex: 1, display:'flex', flexDirection: 'row', margin:0, padding: 0, border: 0}}>
                    <SideNav />
                    <div style={{ background: '#E8E8E8', flex: 1, display: 'flex', alignItems: 'center',flexDirection: 'column' }}>
                        <text >
                            My Portfolio
                    </text>

                    </div>
                </div>
                
            </div>
        );
    }
}
